import React, { Component } from "react";
import axios from "axios";

import "../styles/jukebox.css";

class Jukebox extends Component {
  constructor() {
    super();
    this.state = {
      data: []
    };
    this.getSpotify = this.getSpotify.bind(this);
  }

  getSpotify() {
    axios
      .get("/spotify-req", {
        params: {}
      })
      .then(res => {
        console.log(res.data.songOptions);
        console.log(res.data.answer);
        console.log("it called a thing");
      })
      .catch(err => {});
  }

  loopOptions() {}

  render() {
    return (
      <div id="juke">
        <button id="graph-go" onClick={this.getSpotify}>
          Start
        </button>
      </div>
    );
  }
}

export default Jukebox;

Test = ({ stations = [] }) => (
  <div>
    {stations.map(station => (
      <div className="station" key={station.call}>
        {station.call}
      </div>
    ))}
  </div>
);

